import React, {Component} from 'react';
import './BookListItem.css'

class BookListItem extends Component {
    render() {
        const {book:{title, author}} = this.props
        return (
            <>
                <span>{title}</span>
                <span>{author}</span>
            </>
        );
    }
}

export default BookListItem;
